import React, { Component } from 'react'

export default class genreChecks extends Component {
    constructor(props) {
        super(props);
        console.log(props)
        this.state = {
            id: props.id,
            name: props.name
        }
    }
    render() {

        return (
            <label key={'props.id'} className="genre-option" >
                <input type="checkbox" value={'props.name'} />
                <span className="option-text">{'props.name'}</span>
            </label>
        )
    }
}
